import React from 'react'
import { Row, Col } from 'antd';
import "antd/dist/antd.css";

class Student extends React.Component {
    render() {
        return (
            <>
                <Row>
                    <Col xs={{ span: 11, offset: 1 }} lg={{ span: 6, offset: 2 }}>
                        import {Input} from 'antd';
    </Col>

                </Row>,
            </>
        )
    }
}
export default Student
